import React from "react";
import "../../../Styles/Pages/Shop/ShopFourth.scss";

function ShopFourth() {
  return (
    <div className='shopFourth'>
      <p>Shop by categories</p>
      <div className='shopFourth__row'>
        <div className='shopFourth__col'></div>
        <div className='shopFourth__col'></div>
        <div className='shopFourth__col'></div>
        <div className='shopFourth__col'></div>
      </div>
    </div>
  );
}

export default ShopFourth;
